import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply price range filter
    await page.fill('#minPrice', '100'); // Set minimum price
    await page.fill('#maxPrice', '500'); // Set maximum price
    await page.click('.apply-filter'); // Click apply filter button
    await page.waitForTimeout(1000); // Wait for results to load

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_filter.png'));

    // Verify that products are filtered correctly
    const filteredProducts = await page.$$eval('.product-card', products => {
      return products.map(product => {
        const price = parseFloat(product.querySelector('.product-price').innerText.replace('$', ''));
        return price;
      });
    });

    const allInRange = filteredProducts.every(price => price >= 100 && price <= 500);

    return {
      success: true,
      action: "Applied price range filter and verified products are within range",
      extractedData: { allInRange },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
